import React from "react";
import {Link} from "react-router-dom";
import SecondNavBar from "./SecondNavBar";
import OrderImg from "../../assets/order.svg";
import PendingImg from "../../assets/pending.svg";
import DeliveryImg from "../../assets/delivery.svg";
import ReceivedImg from "../../assets/received.svg";

const UserDashboardNavBar = () => {
    return(
        <div>
            <SecondNavBar />
            <nav>
                <ul className="uldash uldashuser">
                    <Link className="dashnav dashnav1 dashnavuser" to="/userdashboardhome"><li className="dashli"> <img className="dashicon dashicon1 dashuser" src={OrderImg} alt="dash"/> Order</li></Link>
                    <Link className="dashnav dashnav2 dashnavuser" to="/userdashboardreceived"><li className="dashli"> <img className="dashicon dashicon2 dashuser" src={ReceivedImg} alt="dash"/> Received</li></Link>
                    <Link className="dashnav dashnav3 dashnavuser" to="/userdashboardpending"><li className="dashli"> <img className="dashicon dashicon3user dashuser" src={PendingImg} alt="dash"/> Pending</li></Link>
                    <Link className="dashnav dashnav4 dashnavuser" to="/userdashboarddeliveries"><li className="dashli"> <img className="dashicon dashicon4user dashuser" src={DeliveryImg} alt="dash"/> Deliveries</li></Link>
                </ul>
            </nav>
        </div>
    ) 
}

export default UserDashboardNavBar;
